import React from "react";

const VideoList = (props) => {
    console.log(props)
    const VideoItems = (props) => {
        if (props.Response){
            props.Response.data.config.map((video)=> {
                console.log(video)
            })
            return(
                <img src="" />
            )

        }
    }

    return(
        <div>
            <VideoItems />
        </div>
        )
}

export default VideoList;
